toV2 (x,y) = V2 (double2Float x) (double2Float y)

drawAll currentp [] = []
drawAll currentp (DMoveTo p:ds) = drawAll p ds
drawAll currentp (DLineTo p:ds) = toPrim  (Line (toV2 currentp) (toV2 p)) : drawAll p ds
drawAll currentp (DBezierTo c1 c2 p:ds) = toPrim (CubicBezier (toV2 currentp) (toV2 c1) (toV2 c2) (toV2 p)) : drawAll p ds

main :: IO ()
main = do
    let white = PixelRGBA8 255 255 255 255
        black = PixelRGBA8 0 0 0 255
        img = renderDrawing 1000 1000 white $
            withTexture (uniformTexture black) $ do
                stroke 1 JoinRound (CapRound, CapRound) (drawAll (0,0) ds)
                   
    writePng "stage1.png" img